// frontend/src/components/LandingChoice.js

import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Container, Grid, Paper, Typography } from '@mui/material';

function LandingChoice() {
  const navigate = useNavigate();

  const handleActClick = () => {
    // Navigate to the Zip Code Entry page
    navigate('/zipcode-entry');
  };

  const handlePrepareClick = () => {
    // Navigate to a placeholder page for "Prepare" (update this route later as needed)
    navigate('/prepare');
  };

  return (
    <Container
      maxWidth="md"
      sx={{
        height: '100vh',
        backgroundColor: '#003366', // HCA dark blue background
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
      }}
    >
      <Grid container spacing={4} justifyContent="center">
        <Grid item xs={12} sm={6}>
          <Paper
            onClick={handlePrepareClick}
            sx={{
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f8f8f8', // off-white background
              border: '2px solid #FF6600', // orange border
              cursor: 'pointer',
            }}
            elevation={3}
          >
            <Typography variant="h5" sx={{ color: '#003366', fontWeight: 600 }}>
              Prepare
            </Typography>
          </Paper>
        </Grid>
        <Grid item xs={12} sm={6}>
          <Paper
            onClick={handleActClick}
            sx={{
              height: 200,
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              backgroundColor: '#f8f8f8', // off-white background
              border: '2px solid #FF6600', // orange border
              cursor: 'pointer',
            }}
            elevation={3}
          >
            <Typography variant="h5" sx={{ color: '#003366', fontWeight: 600 }}>
              Act
            </Typography>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
}

export default LandingChoice;
